def generate_uuids(count):
    uuids = [uuid4() for i in range(count)]
    return '\n'.join(str(u) for u in uuids)

def generate_e164_number():
    # List of some country codes (you can expand this list)
    country_codes = ['1', '44', '91', '86', '81', '49', '33', '7', '39', '55']
    
    # Choose a random country code
    country_code = random.choice(country_codes)
    
    # Generate a random subscriber number
    # Length can vary, but we'll use a fixed length of 10 for simplicity
    subscriber_number = ''.join([str(random.randint(0, 9)) for _ in range(10)])
    
    # Combine to form E.164 number
    return f"+{country_code}{subscriber_number}"

def generate_phone_numbers(count):
    numbers = [generate_e164_number() for _ in range(count)]
    return '\n'.join(str(u) for u in numbers)

def generate_phone_numbers_better(count):
    country_codes = ["US", "GB", "FR", "DE", "ES"]
    numbers = []
    for i in range(count):
        country_code = random.choice(country_codes)
        example_number = phonenumbers.example_number(country_code)
        phone_number = phonenumbers.format_number(example_number, phonenumbers.PhoneNumberFormat.INTERNATIONAL)
        numbers.append(phone_number)
    return numbers

def generate_random_email():
    # List of common email domains
    domains = ["gmail.com", "yahoo.com", "hotmail.com", "outlook.com", "example.com"]
    
    # Generate a random username
    username_length = random.randint(5, 12)
    username = ''.join(random.choice(string.ascii_lowercase + string.digits) for _ in range(username_length))
    
    # Choose a random domain
    domain = random.choice(domains)
    
    return f"{username}@{domain}"

def generate_emails(count):
    emails = [generate_random_email() for _ in range(count)]
    return '\n'.join(str(e) for e in emails)

def download_image(url, filename):
    response = requests.get(url)
    if response.status_code == 200:
        with open(filename, 'wb') as f:
            f.write(response.content)

def generate_gallery_urls(directory, count):
    directory = directory or '/Users/senaypetros/Documents/UoL/Final Project/Deliverables/Final_Code/backend/media/projectGallery'
    # Get a list of all files in the directory
    all_files = [os.path.join(directory, f) for f in os.listdir(directory) if os.path.isfile(os.path.join(directory, f))]
    media_index = directory.index('media')
    # Select N random files
    selected_files = ['/' + path[media_index:] for path in [random.choice(all_files) for _ in range(count)]]
    
    # Return the paths as a newline-separated string
    return '\n'.join(selected_files)

